import React from 'react';
import './Button.css';

const UIButton = ({ children, className, component: Component, theme,...restProps }) => {
  return (
    <Component className={`ui-button ui-button--${theme} ${className}`} {...restProps}>{children}</Component>
  )
}

UIButton.defaultProps = {
  component: 'button',
  className: '',
  theme: 'bordered-blue'
}

export default UIButton;
